//Dependencies
import React, {Component} from 'react';
import Showcase from './Showcase';
import Browser from './Browser';
import Mybutton from '../MyButton';

class Home extends Component{
  render(){
    return(
      <div className="Home">
        <row>
          <col className="justify-center">
         <Mybutton />
          </col>
        </row>
        <row>
          <Browser/>
        </row>
      </div>
    );
  }
}

export default Home;
